import React from 'react';

function SiswaItem(props){
  if(props.siswa.sent){
    return (
      <tr>
      <td>{props.siswa.nama}</td>
      <td>{props.siswa.umur}</td>
      <td>
      <button className="btn btn-success" type="button">Edit</button>
      <button className="btn btn-danger" type="button">Delete</button>
      </td>
      </tr>
    )
  }else{
    return (
      <tr>
      <td>{props.siswa.nama}</td>
      <td>{props.siswa.umur}</td>
      <td>
      <button className="btn btn-warning" type="button">Resend</button>
      </td>
      </tr>
    )
  }
}

export default SiswaItem;
